import React from 'react';
import Sdata from './Sdata';

const Footer = () => {
  return (
    <h3>
      {Sdata.map((data) => {
        return (
          <div>
            <h1>{data.subject.name}</h1>
            <h2>{data.title}</h2>
            <h3>{data.id}</h3>
          </div>
        );
      })}
    </h3>
  );
};

export default Footer;
